import React from 'react';
import homeicon from '../icons/home_icon_25x25.svg';
import exploreicon from '../icons/explore_icon_25x25.svg';
import treasureicon from '../icons/treasure_icon_25x25.svg';
import profileicon from '../icons/profile_icon_25x25.svg';
import './Footer.css';


function Footer() {

    return (
        <footer>
            <div>
                <ul className="footer__listitems">
                <li>Home<img src={homeicon} width="50" height="50" alt="Homeicon" /></li>
                <li>Explore<img src={exploreicon} width="50" height="50" alt="Exploreicon" /></li>
                <li>Treasures<img src={treasureicon} width="50" height="50" alt="Treasureicon" /></li>
                <li>Profile<img src={profileicon} width="50" height="50" alt="Profileicon" /></li>
                </ul>
            </div>
        </footer>
    )
}

export default Footer;
